package com.demo.model;import java.io.Serializable;import java.util.Date;public abstract class AbstractBaseModel implements Serializable {	private static final long serialVersionUID = -2864262541129787368L;	/** 主键Id */	private Long id;		/** 创建时间 */	private Date createTime;		/** 修改时间 */	private Date updateTime;		public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Date getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Date updateTime) {		this.updateTime = updateTime;	}		}